import React from "react";
import '../styles/Intro.css';
import { Link, NavLink } from "react-router-dom";

function Intro() {
  return (
    <div className="intro">
      <div className="intro-body">
        <NavLink className="shop-mens intro-link" to='/mens' activeClassName="active">
          <div className="link-text">Shop Mens</div>
        </NavLink>
        <NavLink className="shop-womens intro-link" to='/womens' activeClassName="active">
          <div className="link-text">Shop Womens</div>
        </NavLink>
      </div>
    </div>
  )
}

export default Intro;
